  `percentage` double DEFAULT NULL,
  `admin_fee` double DEFAULT NULL,
  `due_date` date DEFAULT NULL,
  `venue` varchar(255) DEFAULT NULL,
  `time` varchar(25) DEFAULT NULL,
  `commencement_date` date DEFAULT NULL,
  `completion_date` date DEFAULT NULL,
  `remarks` text,
  `signature` mediumtext,
  `form_date` date DEFAULT NULL,
  `crm` varchar(255) DEFAULT NULL,
  `sm` varchar(255) DEFAULT NULL,
  `referral_name` varchar(255) DEFAULT NULL,
  `source` varchar(255) DEFAULT NULL,
  `bank_book` varchar(255) DEFAULT NULL,
  `form_created_date` timestamp NULL DEFAULT NULL,
  `form_approved_date` timestamp NULL DEFAULT NULL,
  `form_approved_admin` int(11) DEFAULT NULL,
  `director_id` int(11) DEFAULT NULL,
  `manager_id` int(11) DEFAULT NULL,
  `agent_id` int(11) DEFAULT NULL,
  `marketing` varchar(255) DEFAULT NULL,
  `agreement_type` int(5) DEFAULT NULL COMMENT '1=standard,2=progressive,3=topup',
  `director_signature` text,
  `creator_id` int(11) DEFAULT NULL,
  `creator_type` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`f_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=latin1 AUTO_INCREMENT=32 ;

